import React from "react";
import styles from "./header.module.css";
import { Link } from "react-router-dom";

function Header() {
  return (
    <Link to="/">
      <div className={styles.inner}>
        헤더 영역이야
      </div>
    </Link>
    
  )
}
export default Header;



        <Link to="/">
          <h1 className={styles.logo}>
            <img src="/images/logo.png" alt="logo" />
          </h1>
        </Link>
